import './ExpensesList.css';
import ExpenseItem from './ExpenseItem';
const ExpensesList = (props) => {
    let expenses;
    props.items.length > 0 ? expenses = props.items.map(expense => <ExpenseItem key={expense.id} title={expense.title} amount={expense.amount} date={expense.date} />) : expenses = <p>No items found.</p>;
}

export default ExpensesList;
